import Navbar from  './Components/Navbar'
import './App.css';
import News from './Components/News';


import { BrowserRouter as Router, Route, Link, Switch} 
        from "react-router-dom";

function App() {
  return (
    <>
      <Navbar/>
      <News country={"us"} category ={"health"}/>

      <Router>

      <Switch>

          <Route exact path="/Business"  />

        </Switch>

      </Router>

    </>
  );
}

export default App;
